// React
import React from "react";

function ProcessPage({ posts }) {
  return (
    <div id={"page"}>
      <div id="scrollContent">
        {posts.map((post, index) => {
          return (
            <>
              <div>{post.date}</div>
              <div>{post.text}</div>
              <div>
                {post.images.map((image) => {
                  return <img src={image} />;
                })}
              </div>
            </>
          );
        })}
      </div>
    </div>
  );
}

export default ProcessPage;
